export const handleCallbackResponse = (response) => {
  console.log("Encoded JWT ID token: " + response.credential);
};

export const initializeLogin = google.accounts.id.initialize({
  /* global google */
  client_id:
    "714826054625-knlhrtd804a74g79anl025thrqgne5hs.apps.googleusercontent.com",
  callback: handleCallbackResponse,
});

export const renderLoginBtn = google.accounts.id.renderButton(
  document.getElementById("loginBtn"),
  {
    theme: "outline",
    size: "large",
  }
);
